import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import styled from "styled-components";

function Home() {
  const navigate = useNavigate();
  const [selected, setSelected] = useState(0);
  return (
    <Container>
      <Nav>
        <Logo>TABI</Logo>
        <NavRight>
          <NavRightBtn
            onClick={() => {
              navigate("/log-in");
            }}
          >
            Log In
          </NavRightBtn>
          <NavRightBtn
            onClick={() => {
              navigate("/sign-up");
            }}
          >
            Sign Up
          </NavRightBtn>
        </NavRight>
      </Nav>
      <NavBottom>
        <NavBottomBtn selected={selected === 0 ? "true" : "false"}>
          Home
        </NavBottomBtn>
        <NavBottomBtn selected={selected === 1 ? "true" : "false"}>
          Suzume
        </NavBottomBtn>
        <NavBottomBtn selected={selected === 2 ? "true" : "false"}>
          FAQ
        </NavBottomBtn>
      </NavBottom>
    </Container>
  );
}

export default Home;
const Container = styled.div`
  width: 100vw;
  display: flex;
  flex-direction: column;
`;
const Nav = styled.div`
  width: 100vw;
  display: flex;
  align-items: flex-start;
  justify-content: space-between;
  padding-top: 30px;
`;
const Logo = styled.p`
  font-size: 45px;
  font-weight: 700;
  margin-left: 30px;
`;
const NavRight = styled.div`
  display: flex;
  align-items: center;
  gap: 30px;
  margin-right: 30px;
`;
const NavRightBtn = styled.p`
  cursor: pointer;
  cursor: pointer;
  font-size: 18px;
`;
const NavBottom = styled.div`
  margin-top: 25px;
  display: flex;
  align-items: center;
  gap: 30px;
  margin-left: 30px;
`;
const NavBottomBtn = styled.p`
  cursor: pointer;
  font-size: 28px;
  border-bottom: ${(props) =>
    props.selected === "true" ? "2px solid #000" : "none"};
  opacity: ${(props) => (props.selected === "true" ? 1 : 0.5)};
`;
